function mainCtrl(e,t){e.sampleData={id:"entee",variants:[{id:"forgetting",image:"images/AP_Tee_Large_Forgetting.png",image_thumbnail:"images/AP_Tee_Forgetting.png",price_cents:2400,display_name:"Forgetting Tee"},{id:"logogray",image:"images/AP_Tee_Large_Logo_Gray.png",image_thumbnail:"images/AP_Tee_Logo_Gray.png",price_cents:2400,display_name:"Evernote Logo Tee"},{id:"rorschach",image:"images/AP_Tee_Large_Rorschach.png",image_thumbnail:"images/AP_Tee_Rorschach.png",price_cents:2400,display_name:"Rorschach Tee"},{id:"logogreen",image:"images/AP_Tee_Large_Logo_Green.png",image_thumbnail:"images/AP_Tee_Logo_Green.png",price_cents:2400,display_name:"Evernote Logo Tee"}]};e.selectItems=e.sampleData.variants;e.product=0;e.currentItem=function(t){return e.product===t};e.formData={item_id:e.selectItems[e.product].id,variant_id:e.sampleData.id};e.showItem=function(t){e.product=t;e.formData.item_id=e.selectItems[e.product].id;e.formData.variant_id=e.sampleData.id};e.buyItem=function(){console.log("Sending item_id: "+e.formData.item_id+" and variant_id: "+e.formData.variant_id);t({method:"POST",url:"/buy",data:e.formData,headers:{"Content-Type":"application/x-www-form-urlencoded;"}}).success(function(e){console.log(e)})}}var app=angular.module("picker",[]);app.filter("cents",function(){return function(e){return parseInt(e)/100}});